import { useState } from "react";
import "./App.css";
import { Sidebar } from "./components/Sidebar";
import { Header } from "./components/Header";

function App() {
  const [dark, setDark] = useState(false);

  return (
    <div className={`App flex text-gray-600 ${dark} ? dark : ""`}>
      <div className="w-1/6">
        <Sidebar />
      </div>
      <div className="w-full">
        <Header />
      </div>
    </div>
  );
}

export default App;
